<!DOCTYPE html>
<html lang="en">

<head>
    <title>资源下载</title>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link href="../style/normalize.css" rel="stylesheet" type="text/css" />
    <link href="../style/skeleton.css" rel="stylesheet" type="text/css" />
    <link href="../img/_favicon.png" rel="icon" type="image/png">
    <style>
        body {
            background-color: black;
            margin: 0;
            padding: 0;
        }

        /* 固定底部容器，兼容 PC 和移动端 */
        .fixed-bottom {
            position: fixed;
            bottom: 0;
            left: 0;
            width: 100%;
            background: rgba(0, 0, 0, 0.85);
            padding: 10px 10px;
            text-align: center;
            z-index: 1000;
            box-shadow: 0 -2px 8px rgba(0, 0, 0, 0.5);
        }

        /* 输入框样式；字体大小改为16px，与按钮一致 */
        .input-field {
            width: 75%;
            max-width: 300px;
            font-family: pixel, monospace;
            font-size: 16px;
            background-color: transparent;
            border: none;
            border-bottom: 2px solid rgb(55, 55, 55);
            color: white;
            margin-bottom: 5px;
            outline: none;
            text-align: center;
        }

        /* 针对 placeholder 的字体样式 */
        ::-webkit-input-placeholder {
            font-size: 16px;
        }

        :-ms-input-placeholder {
            font-size: 16px;
        }

        ::placeholder {
            font-size: 16px;
        }

        /* 按钮样式 */
        .download-btn {
            font-family: pixel, monospace;
            font-size: 16px;
            color: lightgrey;
            background-color: transparent;
            border: none;
            cursor: pointer;
            margin: 0 5px;
            text-shadow: 2px 2px 4px #000, -2px -2px 4px #F00;
        }

        /* 禁用时的样式 */
        .download-btn:disabled {
            color: #888;
            cursor: not-allowed;
            opacity: 0.6;
        }

        /* 左右选项 */
        .option-container {
            display: flex;
            justify-content: center;
            margin-top: 10%;
        }

        .option-img {
            width: 150px;
            margin: 0 15px;
            cursor: pointer;
        }

        /* glow-box 样式，仅点击后添加 */
        .glow-box {
            border: 1px solid #fff;
            border-radius: 50%;
            box-shadow: 0 0 15px 5px rgba(255, 255, 255, 0.8);
        }

        /* 响应式处理 */
        @media (max-width: 768px) {
            .option-img {
                width: 120px;
                margin: 0 10px;
            }

            .input-field {
                width: 80%;
            }
        }
    </style>
    <script type="text/javascript">
        // 检查是否在微信中打开
        function isWeixinBrowser() {
            return /micromessenger/i.test(navigator.userAgent);
        }
        if (isWeixinBrowser()) {
            alert("不允许在微信中打开");
            window.location.href = "https://bing.com/";
        }
    </script>
</head>
<script src="../js/remote.js"></script>
<body>
    <!-- 页面中部显示两个选项，点击后选择下载类型 -->
    <div class="option-container">
        <img id="imgOption" data-type="img" class="option-img" src="../img/download_hd.png" alt="高清下载选项" />
    </div>

    <!-- 固定底部的输入框与按钮，初始状态隐藏 -->
    <div id="bottomContainer" class="fixed-bottom" style="display: none;">
        <input id="pswd" class="input-field" placeholder="输入8位资源id" maxlength="8" />
        <button id="goBtn" class="download-btn">Download</button>
        <br>
        <label id="alert"
            style="color: red; font-family: pixel, monospace; font-size: 16px; text-shadow: 2px 2px 4px #000, -2px -2px 4px #F00; margin-top: 5px;"></label>
    </div>

    <script src="../js/jquery.min.js"></script>
